  const onClick = (event) => {
    ss(event.target.outerText);
  };

  // console.log(tabs.chords.A);
  const activeSuff = tabs.chords.A.flatMap((chord) => chord.suffix);
  console.log(activeSuff);

  // for (const ch of tabs.chords.A) {
  //   console.log(ch.suffix);
  // }

  return (
    <div>
      <ListSuffixes>
        {tabs.suffixes.map((suffix) => {
          // console.log(suffix);
          return (
            <ListItem key={suffix} onClick={onClick}>
              {suffix}
            </ListItem>
          );
        })}
      </ListSuffixes>
    </div>
  );
};
